			position: relative;
			transition: all 1000ms cubic-bezier(0.245, 0.000, 0.000, 1.000);
		}
		.spin{
			display: block;
			animation-name: spin;
			animation-duration: 20s;
			animation-iteration-count: infinite;
			animation-timing-function: linear; 
		}
		.spin-anim{
			display: block;
			animation-name: spin;
			animation-duration: 4s;
			animation-iteration-count: infinite;
			animation-timing-function: linear; 
			animation-play-state: paused;
		}

		&:hover .spin-wrap{
			transition: all 600ms cubic-bezier(0.245, 0.000, 0.000, 1.000);
            transform: scale(0.85);
		}
		&:hover .spin{
			animation-play-state: paused;
		}
		&:hover .spin-anim{
			animation-play-state: running;
		}
		&:hover .arrow path{
			fill: #C62828;
		}

		.arrow{
			position: absolute;
			top: 50%;
			left: 50%;
